import React from "react";

function Expense(props) {
  const expense = [
    {
      id: "0",
      title: "named",
      amount: "23.5",
      date: new Date(1987, 4, 26),
    },
    {
      id: "1",
      title: "named",
      amount: "23.5",
      date: new Date(1987, 4, 26),
    },
    {
      id: "2",
      title: "named",
      amount: "23.5",
      date: new Date(1987, 4, 26),
    },
  ];

  return <div></div>;
}

export default Expense;
